          a.montoVenta = quitarItemVacio(get('Formulario.cbMontoVenta', 'T'));

       	  var tipo    = get('Formulario.cbTipo');
	      var desde   = get('Formulario.cbPorcentajeDesde');
  	      var hasta   = get('Formulario.cbPorcentajeHasta');

	  if(validarVariaciones(tipo, desde, hasta)){
	     a.variacionDesde  = obtenerDesde(tipo, desde);
		 a.variacionHasta  = obtenerHasta(tipo, hasta);
	  }

      var tipo2   = get('Formulario.cbTipo2');
	  var desde2  = get('Formulario.cbPorcentajeDesde2');
  	  var hasta2  = get('Formulario.cbPorcentajeHasta2');

	  if(validarVariaciones(tipo2, desde2, hasta2)){
	     a.variacionDesde2  = obtenerDesde(tipo2, desde2);
		 a.variacionHasta2  = obtenerHasta(tipo2, hasta2);
	  }

	  var tipo3   = get('Formulario.cbTipo3');
	  var desde3  = get('Formulario.cbPorcentajeDesde3');
  	  var hasta3  = get('Formulario.cbPorcentajeHasta3');

	  if(validarVariaciones(tipo3, desde3, hasta3)){
	     a.variacionDesde3  = obtenerDesde(tipo3, desde3);
		 a.variacionHasta3  = obtenerHasta(tipo3, hasta3);
	  }

	  var tipo4   = get('Formulario.cbTipo4');
	  var desde4  = get('Formulario.cbPorcentajeDesde4');
  	  var hasta4  = get('Formulario.cbPorcentajeHasta4');

	  if(validarVariaciones(tipo4, desde4, hasta4)){
	     a.variacionDesde4  = obtenerDesde(tipo4, desde4);
		 a.variacionHasta4  = obtenerHasta(tipo4, hasta4);
	  }

	  var tipo5   = get('Formulario.cbTipo5');
	  var desde5  = get('Formulario.cbPorcentajeDesde5');
  	  var hasta5  = get('Formulario.cbPorcentajeHasta5');

	  if(validarVariaciones(tipo5, desde5, hasta5)){
	     a.variacionDesde5  = obtenerDesde(tipo5, desde5);
		 a.variacionHasta5  = obtenerHasta(tipo5, hasta5);
	  }

	  var tipo6   = get('Formulario.cbTipo6');
	  var desde6  = get('Formulario.cbPorcentajeDesde6');
  	  var hasta6  = get('Formulario.cbPorcentajeHasta6');

	  if(validarVariaciones(tipo6, desde6, hasta6)){
	     a.variacionDesde6  = obtenerDesde(tipo6, desde6);
		 a.variacionHasta6  = obtenerHasta(tipo6, hasta6);
	  }

          a.formato = formato;
          mostrarModalSICC('INCVentaConsultorasGanadoras','generar', a);

        }
