    }

 function obtenerDesde(tipo, porcentajeDesde){

    if (tipo == 1){      
      if (porcentajeDesde == '0'){
         variacionDesde = '0';
      }else{
        variacionDesde = porcentajeDesde;
	  }
    }else{
       if (porcentajeDesde == '0'){
         variacionDesde = '100';
       }else{
         variacionDesde = porcentajeDesde;
	   }
    }
    return variacionDesde;
  }

//------------------------------------------------------------------------------

  function obtenerHasta(tipo, porcentajeHasta){

    if (tipo == 1){      
       if (porcentajeHasta == '0'){
          variacionHasta = '100';
       }else{
         variacionHasta = porcentajeHasta;
	   }
    }else{
       if (porcentajeHasta == '0'){
          variacionHasta = '0';
       }else{
        variacionHasta = porcentajeHasta;
	   }
    }
    return variacionHasta;
  }

//------------------------------------------------------------------------------

  function validarVariaciones(tipo, porcDesde, porcHasta){

    desde = porcDesde;
    hasta = porcHasta;

    if (desde != 0 && hasta != 0){

      var desdeN = parseInt(desde, 10);
      var hastaN = parseInt(hasta, 10);

      if (tipo == 1){ //ascendente

        if (desdeN > hastaN){
          cdos_mostrarAlert("Desde no puede ser mayor que Hasta.");
          focaliza('Formulario.cbPorcentajeDesde');
          return false;
        }

      }else{ //descendente

        if (hastaN > desdeN){
          cdos_mostrarAlert("Hasta no puede ser mayor que Desde.");
          focaliza('Formulario.cbPorcentajeHasta');
          return false;
        }

      }

    }

    return true;

  }

